      "description": "<p>This meetup is my SECOND with Resist. It is under the initiative \"Community Square.\" C-SQ was founded in 2004 with an eventual goal to act as a stand alone non profit, but has since been an information platform for positive and spiritual connecting, discussion group in non traditional ways and environs and better living. We are coming together to educate one another about ways to effectively make our voices be known.<br\/>This meetup is part of a series produced by BRIC Arts. It is one of the leading presenters of free cultural programming in NYC. All of the events we will present with the initiative of Meetup's #Resist in mind will be to compliment them. \"How To Do Social Practice\" is a panel discussion to consider ways artists develop projects, secure funding and make a true impact on our community via social practice.<br\/>It will be moderated by Elizabeth Grady, Program Director, \"A Blade Of Grass.\"<\/p> <p>After, we will ask attendees of OUR group to aid in future meetups for other locations in Brooklyn and possibly elsewhere in (and beyond) New York City. This second portion will only take 15-20 minutes.<\/p>",
