      "description": "<p>This year, 2017, will mark the 100th anniversary of the Russian revolutions. This event had such a huge effect on Russia and the world. It\u2019s a very important period to help understand what\u2019s happening in Russia now, and very important for the national consciousness. However, modern Russia has never properly dealt with the legacy of 1917. On the one hand, the Soviet state that came from the revolution was the one that won the war and whose military and scientific achievements Putin thinks should be venerated. But on the other hand Putin has elevated \u201cstability\u201d to being one of the key tenets of his rule, and as such celebrating a revolution goes against the very grain of his political philosophy.<\/p> <p>Since the outbreak of the Ukraine crisis, there has been much talk of a new Cold War between the West and Russia. Under Vladimir Putin\u2019s leadership, Moscow is widely seen as volatile, belligerent and bent on using military force to get its way. Relations between the West and Russia are certainly bad and dangerous but they are bad and dangerous in new ways; crucial differences which make the current rivalry between Russia, the EU and the US all the more fluid and unpredictable. Unpacking the dynamics of this increasingly strained relationship, we will makes a compelling case for handling Russia with pragmatism and care rather than simply giving into fear.<\/p> <p>In this discussion of top Russian foreign and security policy we explains why the Cold War analogy is misleading and what changes we can expect in U.S-Russia relations under the Trump administration.<\/p>",
